import React, { Component } from 'react';
import {
  LoanApproveWrap,
  LoanNoDataMessage,
} from './LoanApprove.style';

class LoanApprove extends Component {
  renderLoanListApprove = (values, index) => {
    console.log('values', values);
    return (
      <LoanListApproveWrap key={index}>

      </LoanListApproveWrap>
    )
  }

  renderNoDataMessage = () => (
    <LoanNoDataMessage>
      Empty Loan
    </LoanNoDataMessage>
  )

  render() {
    const { loanList } = this.props;
    if (loanList.length < 0) return this.renderNoDataMessage();

    return (
      <LoanApproveWrap>
        {loanList.map(this.renderLoanListApprove)}
      </LoanApproveWrap>
    );
  }
}

export default LoanApprove;
